import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";
import LogItem from "../log-item";

const GroupedLog = () => {
    const cdrsData = useSelector(state => state.cdrsData);

    const _renderLogs = (group) => {
        return Object
            .keys(group)
            .map((key, index) => (
                <div key={index}>
                    <p>{key.replace('Logs', '')}</p>
                    {group[key].map((item, i) => (

                        <LogItem item={item} key={i}/>
                    ))}

                </div>
            ));
    };
    const clearDuplicates = (group) => {
        return Object
            .values(group)
            .map((key, index) => {
                    const inboundResult = [...key.reduce((mp, o) => {
                        if (key.direction === "inbound") {
                            const key = JSON.stringify([o.direction, o.from]);
                            if (!mp.has(key)) mp.set(key, {...o, count: 0});
                            mp.get(key).count++;
                            return mp;
                        }

                    }, new Map).values()];

                    console.log("inboundResult", inboundResult);

                    const outboundResult = [...key.reduce((mp, o) => {
                        if (key.direction === "outbound") {

                            const key = JSON.stringify([o.direction, o.from]);
                            if (!mp.has(key)) mp.set(key, {...o, count: 0});
                            mp.get(key).count++;
                            return mp;
                        }
                    }, new Map).values()];

                    console.log("outboundResult", outboundResult);


                }
            )
    }

    function filterArr(data, key) {

        data.forEach(element => {

            let countedData = data.filter((el) => {
                return el[key] == element[key]
            }).length;

            console.log(element[key] + ": " + countedData);
        });

        data = data.filter((item, index, self) => self.findIndex(t => t[key] === item[key] && item[key] != null) === index)
        console.log(data);

        return data;
    }

    return (
        <React.Fragment>
            {
                _renderLogs(cdrsData)
            }
            {
                clearDuplicates(cdrsData)
            }
        </React.Fragment>
    );

};


export default GroupedLog;
